import React from 'react';

interface NavbarProps {
  websiteName: string;
}

const Navbar: React.FC<NavbarProps> = ({ websiteName }) => {
  return (
    <nav>
      <div>{websiteName}</div>
      <ul>
        <li>
          <a href="/about">About</a>
        </li>
        <li>
          <a href="/announcements">Announcements</a>
        </li>
        <li>
          <a href="/signup">Sign Up</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
